import React, {Component, useEffect, useState} from "react";
import axios from 'axios';
import MenuBar from "../components/MenuBar";

function App() {
    useEffect( () => {
        axios.get('/text')
        .then(response => console.log(response.data))
    }, []);

    return (
        <div>
            서버에서 받아오는 연습중
        </div>
    )
}

export default App;
